window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"19.1.2","implementation":{"name":"cucumber-jvm","version":"7.8.0"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"11.0.15.1+2-LTS-10"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1671234836,"nanos":375258900}}},{"source":{"uri":"classpath:features/RetailHomePage.feature","data":"Feature: Retail Home Page\n\n  @allSection\n  Scenario: Verify Shop by Department sidebar\n    Given User is on retail website\n    When User click on All section\n    Then below options are present in shop by Department sidebar\n      | Electronics | Computers | Smart Home | Sports | Automative |\n\n  @sidebarOptions\n  Scenario Outline: Verify department sidebar options\n    Given User is on retail website\n    When User click on All section\n    And User click on <department>\n    Then below options are present in department\n      | <optionOne> | <optionTwo> |\n\n    Examples: \n      | department    | optionOne                        | optionTwo                  |\n      | 'Electronics' | 'TV & Video'                     | 'Video Games'              |\n      | 'Computers'   | 'Accessories'                    | 'Networking'               |\n      | 'Smart Home'  | 'Smart Home Lightning'           | 'Plugs and Outlets'        |\n      | 'Sports'      | 'Athletic Clothing'              | 'Exercise & Fitness'       |\n      | 'Automotive'  | 'Automative Parts & Accessories' | 'MotorCycle & Powersports' |\n\n  @addingToCart\n  Scenario: Verify User can add an item to cart\n    Given User is on retail website\n    When User click on Sign In option\n    And User enter email 'nothing2@gmail.com' and password '123456@Ewq'\n    And User click on login button\n    And User should be logged in into account\n    And User change the category to 'Smart Home'\n    And User search for an item 'kasa outdoor smart plug'\n    And User click on search icon\n    And User click on item\n    And User select quantity '2'\n    And User click add to Cart button\n    Then The cart icon quantity should change to '2'\n  #above scenario will fail without wait time that is why\n  #I used wait in some steps of above scenario\n  \n  @orderWOShippindAdd\n  Scenario: Verify User can place an order without Shipping address and payment Method on file\n    Given User is on retail website\n    When User click on Sign In option\n    And User enter email 'nothing2@gmail.com' and password '123456@Ewq'\n    And User click on login button\n    And User should be logged in into account\n    And User change the category to 'Smart Home'\n    And User search for an item 'kasa outdoor smart plug'\n    And User click on search icon\n    And User click on item\n    And User select quantity '2'\n    And User click add to Cart button\n    And The cart icon quantity should change to '2'\n    And User click on cart option\n    And User click on Proceed to Checkout button\n    And User click add a new address link for shipping address\n    And User fill new address Form With Below Information\n      | country       | fullName     | phoneNumber | streetAddress  | apt | city     | state    | zipCode |\n      | United States | Again Genius |  3242335769 | 2378 somewhere else | 101 | New York | New York |   43002 |\n    And User click Add Your Address button\n    And User click Add a credit card or Debit card for payment Method\n    And User Fill Debit or Credit Card Information\n      | cardNumber       | nameOnCard | expirationMonth | expirationYear | securityCode |\n      | 8934284658007564 | Legend     |              11 |           2028 |          345 |\n    And User click on add your card button\n    And User click on place your order\n    Then a message Should Be Displayed 'Order Placed, Thanks'\n\n  @orderWShipping\n  Scenario: Verify User can place an order with Shipping address and payment Method on file\n    Given User is on retail website\n    When User click on Sign In opti
